import * as React from 'react';
import List from '@mui/material/List';
import ListItem from '@mui/material/ListItem';
import ListItemAvatar from '@mui/material/ListItemAvatar';
import ListItemText from '@mui/material/ListItemText';
import Avatar from '@mui/material/Avatar';
import CalendarToday from '@mui/icons-material/CalendarToday';
import Divider from '@mui/material/Divider';
import Typography from '@mui/material/Typography';
import Chip from '@mui/material/Chip';
import Grid from '@mui/material/Grid';
import { Box } from '@mui/system';
export default function  DetailsCard(props) {
  return (
    <Box>
    <List
      sx={{
        width: '100%',
        height: '100%',

        bgcolor: 'background.paper',
      }}
    >
        <li>
        <Typography
          sx={{ mt: 0.5, ml: 9 }}
          color="text.secondary"
          display="block"
          variant="caption"
        >
          Details
        </Typography>
      </li>
      <ListItem>
        <ListItemText primary="Price Cj" secondary={`North-`} />
      </ListItem>
      <ListItem>
        <ListItemText primary="Catch Phrase" secondary={`North-`} />
      </ListItem>
      <Divider component="li" />
      <ListItem>
        <ListItemText primary="Museum Phrase" secondary="Jan 7, 2014" />
      </ListItem>
      <Divider component="li" variant="inset" />
      <ListItem>
        <ListItemText primary="Shadow Size" secondary="July 20, 2014" />
      </ListItem>
      <Divider/>
    </List>
    </Box>
  );
}
